. Obvio que le dije que sí.

Grabado desde nuestras casas, con el micrófono de nuestros celulares mientras hablábamos por videollamada. Mi celular estaba arriba de una pila de libros, hubo risas, vergüenza y palabras fallidas. Pero activando, comunicando e informando, siempre.

Gracias Mora por invitarme a este pequeño espacio donde podemos alzar nuestra voz por los animales 🌱✊🏼.

Y hablando de otros «ismos», síganla a Mora que habla de feminismo, racisimo, ecologismo (todo para que cumpla la teoría de los «ismos», pero habla sustentabilidad 🤣).

Si te interesó, lo encontrás completo en Spotify. Y si te gustó, no dudes en compartirlo 💬

Hasta que la última jaula quede vacía ❤️
